const body = document.body,
    html = document.documentElement;

const height = Math.max( body.scrollHeight, body.offsetHeight, 
                       html.clientHeight, html.scrollHeight, html.offsetHeight );

const debounce = (func, delay) => {
    let inDebounce
        return function() {
            const context = this
            const args = arguments
                clearTimeout(inDebounce)
                    inDebounce = setTimeout(() => func.apply(context, args), delay)
                        }
                      }


function makeSvg(currSvg, depth = 2, scale = 1) { 
    
    const size = depth === 2 ? (window.innerWidth / 10) : depth === 1 ? (window.innerWidth / 20) : (window.innerWidth / 25); 
    const top = Math.floor(Math.random() * ( height * scale));
    const left = Math.floor(Math.random() *  ( window.innerWidth * scale));
    const opacity = depth === 2 ? 99 : depth === 1 ? 80 : 50;
    const color = depth === 2 ? 'var(--frontColor)' : depth === 1 ? 'var(--middleColor)' : 'var(--backColor)';
    const style = `position:absolute; 
                   left:${left}px; 
                   top:${top}px; 
                   opacity: 1.${opacity}; 
                   fill:${color}; 
                   stroke:${color}; 
                   animation: float ${Math.floor(Math.random() * 10)*10}s ease-in-out infinite;
                   z-index:${depth}`;
  
  // find the end of the first svg tag, split the sting in two and inject style and size
   
    let index = currSvg.indexOf(`>`);
    let first = currSvg.substr(0, index);
    let second = currSvg.substr(index + 1); 
  
    return `${first} width="${size}" style="${style}"> ${second}`;
    
  }
  
