  function generateCloud(){
    const layer1 = svgs.map(svg=>makeSvg(svg,2,1)).join('');
    const layer2 = svgs.map(svg=>makeSvg(svg,0,1.5)).join('');
     
    // set the height of the element to match the document height  
    document.querySelectorAll('.tableau')[0].setAttribute("style", `height:${height}px;`);
    // generate the first layer
    document.querySelectorAll('.layer1')[0].innerHTML=`${layer1 }`;
    // generate the second layer
    document.querySelectorAll('.layer2')[0].innerHTML=`${layer2}`;
  }
  
  window.onresize = debounce(generateCloud, 300);

  generateCloud();

 
  
  
  